INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCategoryDescription','ALL','ALL','A filtering condition by category of the RSS item is specified. <br/>Only RSS item that is exactly the same phrase as the character string specified by the entry/category/@term attribute of ATOM or the item/category element of RSS is displayed.');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCategoryDescription','ALL','ja','RSSアイテムのカテゴリによる絞り込み条件を指定します。<br/>ATOM の entry/category/@term 属性またはRSSの item/category 要素が指定した文字列と完全一致するRSSアイテムのみが表示されます。');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCategoryDescription','ALL','zh','指定RSS项的类别过滤条件。<br/>和指定的ATOM 的 entry/category/@term 属性或RSS的 item/category 要素的文字列完全一致RSS项将被表示');
