INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCreator','ALL','zh','以作者过滤');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCreatorDescription','ALL','ALL','A filtering condition by author name of the RSS item is specified. <br/>Only a RSS item that starts by the character string specified by the author name is displayed.');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCreatorDescription','ALL','ja','RSSアイテムの作者名による絞り込み条件を指定します。<br/>作者名が指定した文字列で始まるRSSアイテムのみが表示されます。');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByCreatorDescription','ALL','zh','指定RSS项的作者名的过滤条件<br/>只有以指定的作者名开始的RSS项被表示');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByTitle','ALL','ALL','Filter by title');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByTitle','ALL','ja','タイトルで絞り込み');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByTitle','ALL','zh','以标题过滤');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByTitleDescription','ALL','ALL','A filtering condition by title of the RSS item is specified. <br/>Only a RSS item that agrees with the condition specified by the title is displayed. <br/>The following descriptions can be used. <br/> - AND retrieval: \\\"A B\\\" (A and B are included)<br/> - OR retrieval: \\\"A OR B\\\" (A or B is included)<br/> - NOT retrieval: \\\"-A\\\" (A is not included )<br/> - Priority condition by parentheses: \\\"(A OR B) C\\\" (A or B is included and C is included )<br/>Usage example: ( Tokyo OR Osaka ) News -Society');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByTitleDescription','ALL','ja','RSSアイテムのタイトルによる絞り込み条件を指定します。<br/>タイトルが指定した条件に合致するRSSアイテムのみが表示されます。<br/>以下の記述が使用できます。<br/>・AND検索： 「A B」 （AおよびBを含む）<br/>・OR検索： 「A OR B」 （AまたはBを含む）<br/>・NOT検索： 「-A」 （Aを含まない）<br/>・括弧による優先条件： 「(A OR B) C」 （AまたはBを含み、かつCを含む）<br/>使用例： (東京 OR 大阪) ニュース -社会');
INSERT INTO `is_i18n` VALUES ('widget','lb_filterByTitleDescription','ALL','zh','指定RSS项的标题的过滤条件。<br/>只有和指定的标题一致的一致的RSS项被表示<br/>能够使用下面的描述。<br/>?AND搜索： 「A B」 （包含A和B）<br/>?OR搜索： 「A OR B」 （包含A或者B）<br/>?NOT搜索： 「-A」 （不包含A）<br/>?括号的优先条件： 「(A OR B) C」 （包含A或者B、并且包含C）<br/>使用例： (东京 OR 大阪) 新闻 -社会');
