INSERT INTO `is_menus` VALUES ('sidemenu','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<sites>\r\n	<site-top id=\"news\" title=\"%{news}\">\r\n	    <site id=\"news_asahi\" title=\"asahi.com\" href=\"http://www.asahi.com/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://rss.asahi.com/f/asahi_newsheadlines</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_cnet\" title=\"CNET Japan\" href=\"http://japan.cnet.com/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://feeds.japan.cnet.com/cnet/rss</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_gigazine\" title=\"GIGAZINE\" href=\"http://gigazine.net/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://feed.rssad.jp/rss/gigazine/rss_2.0</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_jcast\" title=\"J-CAST\" href=\"http://www.j-cast.com/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://feed.rssad.jp/rss/jcast/index.xml</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_keitaiwatch\" title=\"ケータイ Watch\" href=\"http://k-tai.impress.co.jp/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://rss.rssad.jp/rss/k-taiwatch/k-tai.rdf</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_slashdotjp\" title=\"Slashdot JP\" href=\"http://slashdot.jp/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://rss.rssad.jp/rss/slashdot/slashdot.rss</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_mycom\" title=\"マイコミジャーナル\" href=\"http://journal.mycom.co.jp/\" type=\"MultiRssReader\">\r\n	    	<properties>\r\n	    		<property name=\"url\">http://feeds.journal.mycom.co.jp/rss/mycom/index</property>\r\n	    	</properties>\r\n	    </site>\r\n	    <site id=\"news_atmarkit\" title