INSERT INTO `is_proxyconfs` VALUES (0,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<proxy-config>\r\n	<case id=\"_1\" pattern=\"^http://localhost(:[0-9]*)?/.*\" type=\"direct\" intranet=\"true\"/>\r\n	<default id=\"_2\" type=\"direct\" cacheLifeTime=\"10\" intranet=\"false\">\r\n		<headers>\r\n			<header>Connection</header>\r\n			<header>Date</header>\r\n			<header>Pragma</header>\r\n			<header>Upgrade</header>\r\n			<header>Via</header>\r\n			<header>Accept</header>\r\n			<header>Accept-Charset</header>\r\n			<header>Accept-Language</header>\r\n			<header>Authorization</header>\r\n			<header>Expect</header>\r\n			<header>From</header>\r\n			<header>Max-Forwards</header>\r\n			<header>Proxy-Authorization</header>\r\n			<header>Range</header>\r\n			<header>Referer</header>\r\n			<header>Te</header>\r\n			<header>User-Agent</header>\r\n			<header>Cookie</header>\r\n			<header>Content-Type</header>\r\n			<header>Content-Encoding</header>\r\n			<header>Transfer-Encoding</header>\r\n			<header>Content-Disposition</header>\r\n			<header>Cache-Control</header>\r\n			<header>If-Match</header>\r\n			<header>If-Modified-Since</header>\r\n			<header>If-None-Match</header>\r\n			<header>If-Range</header>\r\n			<header>If-Unmodified-Since</header>\r\n		</headers>\r\n	</default>\r\n</proxy-config>','1999-12-31 15:00:01');
INSERT INTO `is_searchengines` VALUES (0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<searchEngines>\r\n	<defaultSearch>\r\n		<!-- <searchEngine id=\"google\" defaultSelected=\"true\" title=\"Google\" retrieveUrl=\"http://www.google.co.jp/search?q=\">\r\n			<countRule method=\"regexp\" value=\"約? ([0-9,]+) 件|約? &lt;b&gt;([0-9,]+)&lt;\\/b&gt; 件\"/>\r\n		</searchEngine> -->\r\n		<searchEngine id=\"bing\" defaultSelected=\"true\" title=\"Bing\" retrieveUrl=\"http://www.bing.com/search?mkt=ja-JP&amp;setlang=match&amp;q=\">\r\n			<countRule method=\"regexp\" value=\"([0-9,]+) 件\"/>\r\n		</searchEngine>\r\n		<searchEngine id=\"yahoojapan\" defaultSelected=\"true\" title=\"Yahoo! Japan\" retrieveUrl=\"http://search.yahoo.co.jp/search?p=\">\r\n			<countRule method=\"regexp\" value=\"約&lt;span class=&quot;bo&quot;&gt;([0-9,]+)&lt;/span&gt;件\"/>\r\n		</searchEngine>\r\n	</defaultSearch>\r\n	<rssSearch>\r\n		<searchEngine id=\"bingsite\" retrieveUrl=\"http://www.bing.com/search?mkt=ja-JP&amp;setlang=match&amp;q=site%3A$1%20\">\r\n			<rssPattern>^http://([^/]+)/.*</rssPattern>\r\n			<countRule method=\"regexp\" value=\"([0-9,]+) 件\" />\r\n		</searchEngine>\r\n		<!-- setting example for searching RSS in Google in-site search if the rss does not match with the above\r\n		<searchEngine id=\"googlesite\" retrieveUrl=\"http://www.google.com/search?&amp;q=site%3A$1%20\">\r\n			<rssPattern>^http://([^/]+)/.*</rssPattern>\r\n			<countRule method=\"regexp\" value=\"約? ([0-9,]+) 件|約? &lt;b&gt;([0-9,]+)&lt;\\/b&gt; 件\"/>\r\n		</searchEngine> -->\r\n	</rssSearch>\r\n</searchEngines>');
