value=\"postCredential\" value=\"postCredential\"/>\r\n		<EnumValue display_value=\"postPortalCredential\" value=\"postPortalCredential\"/>\r\n		<EnumValue display_value=\"sendPortalCredentialHeader\" value=\"sendPortalCredentialHeader\"/>\r\n		<EnumValue display_value=\"signed\" value=\"signed\"/>\r\n	</UserPref>\r\n	<UserPref default_value=\"\" datatype=\"hidden\" name=\"additional_css\" display_name=\"!{lb_additionalCss}\" admin_datatype=\"textarea\"/>\r\n	<Header/>\r\n	<Content className=\"FragmentMiniBrowser\" type=\"javascript\"/>\r\n</widgetConfiguration>\r\n');
INSERT INTO `is_widgetconfs` VALUES ('Information','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<widgetConfiguration autoRefresh=\"true\" backgroundColor=\"#FFFFFF\" displayFlag=\"false\" type=\"Information\" title=\"!{lb_Information}\">\r\n	<WidgetPref datatype=\"string\" display_name=\"!{lb_dateTimeFormat}\" name=\"dateTimeFormat\" value=\"yyyy/MM/dd\"/>\r\n	<WidgetPref datatype=\"bool\" display_name=\"!{lb_useAccessStat}\" name=\"useAccessStat\" value=\"true\"/>\r\n	<UserPref default_value=\"\" datatype=\"hidden\" name=\"url\" display_name=\"RSS URL\" required=\"true\" admin_datatype=\"url\"/>\r\n	<UserPref default_value=\"false\" datatype=\"hidden\" name=\"iframeview\"/>\r\n	<UserPref default_value=\"false\" display_name=\"!{lb_doLineFeed}\" datatype=\"hidden\" name=\"doLineFeed\"/>\r\n	<UserPref default_value=\"true\" display_name=\"!{lb_doShowDatetime}\" datatype=\"hidden\" name=\"showDatetime\"/>\r\n	<Header>\r\n		<menu alt=\"!{lb_accessStats}\" imgUrl=\"group.gif\" type=\"accessStats\"/>\r\n		<menu alt=\"!{lb_lineFeed}\" imgUrl=\"display_break.gif\" type=\"lineFeed\"/>\r\n	</Header>\r\n	<Content className=\"Information\" type=\"javascript\"/>\r\n	<Maximize>\r\n		<Header>\r\n			<icon alt=\"!{lb_iframeviewkey}\" imgUrl=\"html_gray.gif\" type=\"iframeview_on\"/>\r\n			<icon alt=\"!{lb_summaryViewKey}\" imgUrl=\"html_valid.gif\" type=\"iframeview_off\"/>\r\n			<icon alt=\"!{lb_dateDisplayKey}\" imgUrl=\"display_time.gif\" type=\"date\"/>\r\n			<icon alt=\"!{lb_helpKey}\" imgUrl=\"help.gif\" type=\"showShortcuts\"/>\r\n		</Header>\r\n		<Content className=\"MaximizeRssReader\" type=\"javascript\"/>\r\n	</Maximize>\r\n</widgetConfiguration>\r\n');
